import React from 'react';

const ImgCard = ({ className }) => {
  return (
    <div className="col-sm-12">
      <div className={className}>
        <img src="/images/img_2.png" height="100%" width="100%" />
      </div>
    </div>
  );
};

export default ImgCard;
